import styled from 'styled-components';

export const TextSemi26 = styled.h3`
  font-size: 1.625rem; // 26px
  font-weight: 600;
  line-height: 24;
`;

export const HeadingSemi = styled.h3`
  font-size: 1.375rem; //22px
  font-weight: 600;
  line-height: 24px;
  color: #555770;
  margin: 0;
`;

export const HeadingRegular = styled.h3`
  font-size: 1.375rem; //22px
  font-weight: 300;
  line-height: 24px;
  color: #555770;
  margin: 0;
`;

export const TextMedium = styled.h3`
  font-weight: 500;
  font-size: 1.25rem;
  line-height: 24px;
  color: #555770;
  margin: 0;
`;

export const TextSemi = styled.h3`
  font-weight: 600;
  font-size: 1rem;
  line-height: 24px;
  color: #555770;
  margin: 0;
`;

export const TextMedium16 = styled.h3`
  font-weight: 500;
  font-size: 1rem;
  line-height: 24px;
  color: #555770;
  margin: 0;
`;
